import React, { useEffect, useState } from "react";
import { Line, Scatter, Bar } from "react-chartjs-2";
import { socket } from "../socket";
import { Chart, registerables } from "chart.js";
Chart.register(...registerables);

function SoterradoDashboard() {
  const [data, setData] = useState([]);

  useEffect(() => {
    let interval;
    try {
      //  Backend real (cuando est茅 activo)
      socket.on("nuevoDatoSoterrado", (dato) => {
        // Los datos reales tendr谩n estructura:
        // { time, object: { vibration, methane, moisture, temperature } }
        setData((prev) => [...prev.slice(-49), dato]);
      });

      // И Simulaci贸n temporal
      interval = setInterval(() => {
        const simulacion = {
          time: new Date().toISOString(),
          object: {
            vibration: (Math.random() * 100).toFixed(2),
            methane: (Math.random() * 10).toFixed(2),
            moisture: (30 + Math.random() * 60).toFixed(2),
            temperature: (12 + Math.random() * 10).toFixed(2),
          },
        };
        setData((prev) => [...prev.slice(-49), simulacion]);
      }, 1000);
    } catch (err) {
      console.warn("锔 Sin conexi贸n al backend, usando datos simulados...");
    }

    return () => {
      socket.off("nuevoDatoSoterrado");
      clearInterval(interval);
    };
  }, []);

  // --- Datos base ---
  const labels = data.map((d) => new Date(d.time).toLocaleTimeString());

  // --- 1锔 Vibraci贸n y Metano ---
  const vibMeth = {
    labels,
    datasets: [
      { label: "Vibraci贸n (Hz)", data: data.map((d) => d.object.vibration), borderColor: "purple", fill: false },
      { label: "Metano (ppm)", data: data.map((d) => d.object.methane), borderColor: "orange", fill: false },
    ],
  };

  // --- 2锔 Humedad vs Temperatura ---
  const scatterData = {
    datasets: [
      {
        label: "Humedad vs Temperatura",
        data: data.map((d) => ({ x: d.object.moisture, y: d.object.temperature })),
        backgroundColor: "#42a5f5",
      },
    ],
  };

  // --- 3锔 Temperatura promedio por sensor (simulado) ---
  const avgTemp = {
    labels: ["Sensor Soterrado 1", "Sensor Soterrado 2", "Sensor Soterrado 3"],
    datasets: [
      { label: "Temperatura promedio (掳C)", data: [17.5, 18.2, 19.1], backgroundColor: "#e57373" },
    ],
  };

  // --- 4锔 Matriz de correlaciones (simulada) ---
  const corrData = {
    labels: ["Vibraci贸n", "Metano", "Humedad", "Temp."],
    datasets: [
      { label: "Correlaci贸n simulada", data: [0.72, 0.55, -0.18, 0.83], backgroundColor: ["#ba68c8", "#ffb74d", "#64b5f6", "#81c784"] },
    ],
  };

  return (
    <div className="dashboard">
      <h2> Sensor Soterrado</h2>
      <p style={{ color: "gray" }}> Datos simulados (1 actualizaci贸n por segundo)</p>

      <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: "25px", marginTop: "20px" }}>
        {/* 1锔 Vibraci贸n y Metano */}
        <div style={{ backgroundColor: "#1e1e1e", padding: 20, borderRadius: 10 }}>
          <Line data={vibMeth} />
        </div>

        {/* 2锔 Humedad vs Temperatura */}
        <div style={{ backgroundColor: "#1e1e1e", padding: 20, borderRadius: 10 }}>
          <Scatter data={scatterData} options={{ scales: { x: { title: { display: true, text: "Humedad (%)" } }, y: { title: { display: true, text: "Temperatura (掳C)" } } } }} />
        </div>

        {/* 3锔 Temperatura promedio por sensor */}
        <div style={{ backgroundColor: "#1e1e1e", padding: 20, borderRadius: 10 }}>
          <Bar data={avgTemp} />
        </div>

        {/* 4锔 Correlaciones */}
        <div style={{ backgroundColor: "#1e1e1e", padding: 20, borderRadius: 10 }}>
          <Bar data={corrData} options={{ plugins: { legend: { display: false } } }} />
        </div>
      </div>
    </div>
  );
}

export default SoterradoDashboard;
